import React, { useRef, useState } from 'react';
import MovingObject2 from './MovingObject2';

const MovingObjectsContainer = () => {
  const [yValues, setYValues] = useState(Array(5).fill(0));

  const handleYChange = (index, value) => {
    const newYValues = [...yValues];
    newYValues[index] = value;
    console.log(newYValues);
    setYValues(newYValues);
  };

  return (
    <div>
      {yValues.map((y, index) => (
        <div key={index}>
          <input
            type="number"
            value={y}
            onChange={(e) => {
              console.log(e.target.value);
              handleYChange(index, e.target.value);
            }}
          />
          <MovingObject2 y={y} />
        </div>
      ))}
    </div>
  );
};

export default MovingObjectsContainer;
